    clearfix                = d.createElement("div");
    boxMainCellsContainer   = d.createElement("div");
    tooltip                 = d.createElement("div");
    weekDaysRow             = d.createElement("div");
    clearfix2               = d.createElement("div");
    
    this.setC(clearfix, "clearfix");
